import axios from "axios";

export const StartPage = () => {
  const handleStart = async () => {
    try {
      const response = await axios.post(`http://localhost:3000/search`);
      console.log(response);
    } catch (e) {
      console.error(e);
    }
  };

  return (
    <div>
      <h1>Welcome to GamePlay!</h1>
      <button>Start</button>
    </div>
  );
};

// http://localhost:3000/search
